script: |
  super -f text -I q2249.spq | sort > q2249.out

inputs:
  - name: q2249.spq
    data: |
      SELECT e
      FROM t1 (FORMAT parquet)
      WHERE d NOT BETWEEN 110 AND 150
      AND (e>c OR e<d)
      AND d>e
      ORDER BY 1;
  - name: t1

outputs:
  - name: q2249.out
    data: |
      162
      180
      210
      221
      230
      237
      246
